import React, {Component} from 'react';
import 'bootstrap/dist/css/'

import logo from './img/logo.png';
import './css/addFeedback.css';



class addFeedback extends Component{

  render() {
    return(
        <div>
            <div className='content'>
                <div className='logo'>
                    <img src = {logo}/>
                </div>

                <div className='row'>

                </div>
            </div>
        </div>
    );
  }
}

export default addFeedback;
